(2, 'RFQ form', 'Design RFQ form for Web Site and LIMS and Excel.', '1622632358Screenshot (1).png', 0, 1, 19, 1, '2021-06-02', '2021-06-02', NULL, NULL, NULL, '2021-06-02 23:12:38', '2021-06-02 23:12:38'),
(3, 'RFQ form', 'Add Items form should contain UOM below Range Row.', '1622632996Screenshot (2).png', 2, 1, 19, 1, '2021-06-02', '2021-06-03', '2021-06-03 12:19:29', '2021-06-03 12:36:25', NULL, '2021-06-02 23:23:16', '2021-06-03 19:36:25'),
(4, 'RFQ form', 'Accredited Scope should be added into system. Item parameter being added should be compared with scope parameter and range. Incase covered in accredited scope and falling within range should automatically select accredited / non accredited status.', '1622633332Screenshot (2).png', 1, 1, 19, 1, '2021-06-02', '2021-06-07', '2021-06-03 02:37:57', NULL, NULL, '2021-06-02 23:28:52', '2021-06-03 21:37:57'),
(5, 'RFQ form', 'For Non Listed item form Replace Quantity with Parameter Field.', '1622633574Screenshot (3).png', 2, 1, 19, 1, '2021-06-02', '2021-06-07', '2021-06-04 11:40:58', '2021-06-04 12:03:44', NULL, '2021-06-02 23:32:54', '2021-06-04 19:03:44'),
(6, 'Request Review Field', 'For Checks add fourth Check as Sub-Contracting. In that case TM will Check Sub-Contractor, System should ask for sub-contractor details. Should come from Approved Vendor List which are capable for doing subject calibration. Sub-Contracting item should be identified in quote and details for sub-contractor will be shared with customer.', '1622633920Screenshot (4).png', 2, 1, 19, 1, '2021-06-02', '2021-06-07', '2021-06-03 12:05:24', '2021-06-04 12:10:23', NULL, '2021-06-02 23:38:40', '2021-06-04 19:10:23'),
(7, 'Request Review Field', 'When adding Non-listed into list UOM should be dropped as per selected parameter only.', '1622634435Screenshot (4).png', 1, 1, 19, 1, '2021-06-02', '2021-06-07', '2021-06-05 11:39:35', NULL, NULL, '2021-06-02 23:47:15', '2021-06-05 18:39:35'),
(8, 'Request Review Field', 'For non listed item should be reflected in quote as no capability with 0 price and actual requested quantities.', '1622634902Screenshot (4).png', 1, 1, 19, 1, '2021-06-02', '2021-06-07', '2021-06-03 12:15:37', NULL, NULL, '2021-06-02 23:55:02', '2021-06-03 19:15:37'),
(9, 'Quote Form', 'Quote Number should be serialized. Only relevant payment term should be shown on the quote.', '1622635336Screenshot (4).png', 2, 1, 19, 1, '2021-06-02', '2021-06-07', '2021-06-03 11:54:00', '2021-06-03 12:00:07', NULL, '2021-06-03 00:02:16', '2021-06-03 19:00:07'),
(10, 'Quote Form', 'For revised quote revision number is incremented and while savaging should save as separate quote with updated revision number.', '1622635654Screenshot (4).png', 2, 0, 19, 1, '2021-06-02', '2021-06-07', '2021-06-03 11:07:10', '2021-06-03 12:00:54', NULL, '2021-06-03 00:07:34', '2021-06-03 19:00:54'),
(11, 'Quote Show', 'While adding approval details for new/old customer not having purchaser detail should come up with prompt asking for Purchase detail entry into system.', '1622636354Screenshot (6).png', 1, 0, 19, 1, '2021-06-02', '2021-06-07', '2021-06-03 12:03:00', NULL, NULL, '2021-06-03 00:19:14', '2021-06-03 19:03:00'),
(12, 'Job Detail', 'Assign Job for site item should appear as in attached excel format. Only Authorized technician should drop down in assign tech box and pre-defined cal asset should automatically drop down in assign asset box. All Pre-assigned tech and cal asset should not be visible. Moreover, tech on leave or sick or already on site job should not be visible.', '1622638078Screenshot (7).png', 0, 0, 19, 1, '2021-06-02', '2021-06-07', NULL, NULL, NULL, '2021-06-03 00:47:58', '2021-06-03 00:47:58'),
(13, 'Task Notification', 'Whenever someone assign task to me, i will be notify with Notification', '', 1, 1, 19, 19, '2021-06-03', '2021-06-03', '2021-06-03 10:06:30', NULL, NULL, '2021-06-03 17:00:23', '2021-06-03 17:06:30'),
(14, 'LIMS', 'Select template for our prodcut', '', 2, 0, 19, 19, '2021-06-03', '2021-06-05', '2021-06-04 09:33:55', '2021-06-12 02:46:56', NULL, '2021-06-03 17:34:52', '2021-06-12 21:46:56'),
(15, 'Technical Forms Serials', 'QTN / 000 000\r\nDN / 000 000\r\nJN / 000 000', '', 1, 0, 19, 19, '2021-06-03', '2021-06-05', '2021-06-03 11:21:19', NULL, NULL, '2021-06-03 18:21:00', '2021-06-03 18:21:19'),
(16, 'Customer Add', 'Add customer principal names in separate table', '', 0, 0, 19, 19, '2021-06-04', '2021-06-05', NULL, NULL, NULL, '2021-06-04 16:32:24', '2021-06-04 16:32:24'),
(17, 'Permissions', 'Create all permissions of this App.', '', 1, 0, 19, 19, '2021-06-04', '2021-06-05', '2021-06-12 02:46:19', NULL, NULL, '2021-06-04 16:33:01', '2021-06-12 21:46:19'),
(18, 'Capabilities', 'Capabilities data should be strong enough so that while adding quote items it can verify either it is accredit item or not. For this accredit scope should be updated in it. Also we need to define units in capability list and we need to assign units.', '', 2, 0, 19, 19, '2021-06-04', '2021-06-04', '2021-06-12 02:45:35', '2021-06-12 03:05:22', NULL, '2021-06-04 18:33:34', '2021-06-12 22:05:22'),
(19, 'Parameter and Units', 'add primary unit in parameter and secondary units and its conversion factors in manage units.', '', 2, 1, 19, 1, '2021-06-08', '2021-06-09', '2021-06-12 02:45:14', '2021-06-12 02:45:40', NULL, '2021-06-09 03:47:35', '2021-06-12 21:45:40');
